from typing import List
class Solution:
    def maxIceCream(self, costs: List[int], coins: int) -> int:
        if sum(costs) <= coins: return len(costs)
        if min(costs) > coins: return 0
        costs.sort()
        res = 0
        for i in range(len(costs)):
            res += costs[i]
            if res == coins:
                break
            elif res > coins:
                i -= 1
                break
        return i+1
